    return (
        <>
            <header>

                <Navbar />
                <Link to="#main" className="skip" title="Skip to main content" tabIndex="-1" target="_self">Skip to main content</Link>

            </header>

            <main>

                <Outlet />

            </main>

            <footer className="p-4 bottom-0">
                <Footer />
            </footer>
        </>
    )
};

export default Layout;
